/// NavigationBar.js
import React from 'react';
import '../Components/NavigationBar.css';

const NavigationBar = () => {
  return (
    <nav className="navbar">
      <ul className="navbar-nav">
        <NavItem link="#" text="Home" />
        <DropdownNavItem text="Programs">
          <DropdownItem text="Information Technology" />
          <DropdownItem text="Software Engineering" />
          <DropdownItem text="Information Systems" />
          <DropdownItem text="Cyber Security" />
          <DropdownItem text="Data Science" />
          <DropdownItem text="Computer Systems & Network Engineering" />
        </DropdownNavItem>
        <NavItem link="#" text="My Courses" />
        <NavItem link="#" text="About Us" />
      </ul>
    </nav>
  );
}

const NavItem = ({ link, text }) => {
  return (
    <li className="nav-item">
      <a href={link} className="nav-link">{text}</a>
    </li>
  );
}

const DropdownNavItem = ({ text, children }) => {
  return (
    <li className="nav-item dropdown">
      <a href="#" className="nav-link dropdown-toggle">{text}</a>
      <div className="dropdown-menu">
        {children}
      </div>
    </li>
  );
}

const DropdownItem = ({ text }) => {
  return (
    <a href="#" className="dropdown-item">{text}</a>
  );
}

export default NavigationBar;
